import React, { Component } from "react";
import Card from "./Card";
import "./gallery.css";

export default class Gallery extends Component {
  render() {
    return (
      <div className="gallery container">
        <Card />

        <Card />
        <Card />
        <Card />
        <Card />
      </div>
    );
  }
}
